import './App.css';

import React, { Component } from 'react'
import NavBar from './components/NavBar';
import News from './components/News';
import { Routes, Route, BrowserRouter } from "react-router-dom";

export default class App extends Component {
  // c="ram";
  render() {
    return (

      <div>
        <BrowserRouter></BrowserRouter>
        <NavBar/>
        <News pageSize={10} country="in" category="sports"/>
        <Routes>
        <Route path="/sports" element={<News pageSize={10} country="in" category="sports"/>} />
        <Route path="/health" element={<News pageSize={10} country="in" category="health"/>} />
        <Route path="/business" element={<News pageSize={10} country="in" category="business"/>} />
        <Route path="/entertainment" element={<News pageSize={10} country="in" category="sports"/>} />
        <Route path="/sports" element={<News pageSize={10} country="in" category="sports"/>} />
        <Route path="/sports" element={<News pageSize={10} country="in" category="sports"/>} />
      </Routes>
         general  science sports technology
      <BrowserRouter/>
      </div>

    )
  }
}
